import React from "react";
import { Link } from "react-router-dom";

const EventsPage = () => {
  return (
    <>
      <h1>hello 2</h1>
      {DUMMY_DATA.map((event) => (
        <li key={event.id}>
          <Link to={event.id}> {event.title}</Link>
        </li>
      ))}
    </>
  );
};

export default EventsPage;
